import React from "react";
import "./Css/bottomnavbar.css";
import Instagram from "./Images/insta.png";
import tiktok from "./Images/tiktok.png";
import youtube from "./Images/youtube.png";
import { useNavigate } from "react-router-dom";
function Bottomnavbar() {
const navigate = useNavigate();
  const socialLinks = {
    LocusMotivation: [
      {
        id: 1,
        name: "Tiktok",
        img: tiktok,
        link: ["https://www.tiktok.com/@locusmotivation"]
      },
      {
        id: 1,
        name: "Instagram",
        img: Instagram,
        link: ["https://www.instagram.com/locusmotivation/"]
      },
      {
        name: "YouTube",
        img: youtube,
        link: ["https://www.youtube.com/@LocusMotivation"]
      }
    ],

    MotivationReflect: [
      {
        name: "Tiktok",
        img: tiktok,
        link: ["https://www.tiktok.com/@motivationreflect"]
      },
      {
        name: "Instagram",
        img: Instagram,
        link: ["https://www.instagram.com/motivationreflects/"]
      },
      {
        name: "YouTube",
        img: youtube,
        link: ["https://www.youtube.com/@MotivationLearnReflect"]
      }
    ],

    LearnReflectSystem: [
      {
        name: "Tiktok",
        img: tiktok,
        link: ["https://www.tiktok.com/@learnreflectsmotivation"]
      },
      {
        name: "Instagram",
        img: Instagram,
        link: ["https://www.instagram.com/learnreflects/"]
      },
      {
        name: "YouTube",
        img: youtube,
        link: ["https://www.youtube.com/@MotivationLearnReflect"]
      }
    ]
  };

  return (
    <div>
      <p className="collab">collaboration Socials</p>
      <div className="BottomNavBar-Container">
        <div className="collaboration">
        {Object.entries(socialLinks).map(([groupname,links]) => (
          <div key={groupname}>
          <ul>{groupname}</ul>
          {links.map(({ name, img, link}) => (
            <img alt={name} src={img} onclick={() => navigate(link)}/>
          ))}
          </div>
        ))}
        </div>
      </div>
    </div>
  );
}
export default Bottomnavbar;
